import amzdata,{amazon} from "./database.json";
import flipdata,{flipkart} from "./database.json";
import './App.css';
// console.log(flipkart);
const Amazoncard=()=>{
    return(
    <div className="amazonbox">
    {amzdata.amazon.map(x => {
        return( 
          <div key={x.id} className="amazoncard">
          <img src={x.image} alt={x.image} className="productimage"/><br/>
          <a href={x.link}>{x.detials.name}</a><br/>
          <p>PRICE: {x.detials.price}</p>
          <p>RATING: {x.detials.rating}</p>
          <p>DETIALS: {x.detials.offer}</p>
          </div>
        )
      })}
</div>);
}

const Flipkartcards=()=>{
  return(
    <div classname="flipkartbox">
          {flipdata.flipkart.map(y => {
              return(
                  <div key={y.id} classname="clr">
                      <img src={y.image} alt={y.name}/><br/>
                      <a href={y.link}>{y.name}</a><br/>
                      <p>{y.detials.price}</p>
                      <p>{y.detials.rating}</p>
                      <p>{y.detials.offer}</p>
                  </div>
                      )
              })}
    </div>
  );
}
export {Flipkartcards,Amazoncard}
